import React from "react";

import Todo from "./Todo.js"

function TodoList(){
    return(
        <div>
        <ol className="notCompleted">
        <h3>NOT COMPLETED</h3>
       <Todo/>
    </ol>

    <ol className="Completed">
        <h3>COMPLETED</h3>
    </ol>
    </div>
    )
}
export default TodoList;
